          "image" : "img/img8.jpg",
          "body":"Released in 1998, the Air Max Plus introduced Nike's Tuned Air system.[11] It is often referred to as the Air Max TN. Designed by Sean McDowell, the Air Max Plus featured transverse waves inspired by palm trees, and a prominent arch shank inspired by a whale tail. The initial release featured a Hyper Blue colorway, characterized by a fading blue airbrush effect. The Nike swoosh had a slightly irregular appearance as a border was added along the inner edge, as opposed to the outer surface.",
          "link":"",
          "id":7
      },
      {
          "name": "Air Max 360",
          "year": 2006,
          "image" : "img/img9.jpg",
          "body":"On January 21, 2006 Nike launched the Air Max 360, a new shoe design that utilized Max Air throughout the shoe's midsole. In September 2006 Nike introduced a special 'one time only pack' which fused the 360 model with three classics. The three shoes used were the Air Max 90, Air Max 95, and Air Max 97. For this special release, the design of the 360 sole was used in place of the normal sole of the three classics. The shoes were released in the three original colors: red for the Air Max 90, green/yellow for the Air Max 95, and grey/silver for the Air Max 97. Like other Air Max releases, deluxe editions were also produced. These deluxe editions lasted for about 500 miles (800 km) before their shock-absorbing properties deteriorated. The use of '360' of air cushioning is meant to ensure the shoe's longevity.",
