          "year": 2017,
          "image" : "img/img10.jpg",
          "body":"The Air VaporMax released in March 2017, and was the first Air Max shoe to use no foam or rubber whatsoever in the midsole or outsole.[13] It discarded a traditional midsole/outsole design and in place used several entirely hollow air pouches, not connected to one another and positioned in different areas in accordance with where the wearer's foot would naturally strike. The VaporMax sole itself has not been significantly innovated upon since its initial release, but original shoes using the sole design continue to be released, including several hybrids which fuse a VaporMax sole with the upper design of an older Air Max shoe such as the Air Max 95, 97, and 360.",
          "link":"",
          "id":9
      },
      {
          "name": "Air Max 270",
          "year": 2018,
          "image" : "img/img11.jpg",
          "body":"he shoe was originally released on February 1, 2018. It was named 270 for the 270 degrees of visibility in the Air unit around the shoe, and was inspired by the Air Max 93 and 180 shoes.[14] It was the first Air Max shoe to be designed for lifestyle purposes rather than running.[14] It also was the tallest Air unit to ever be released at the time, measuring 32 mm tall.",
          "link":"",
          "id":10
      },
      {
          "name": "Air Max 720",
          "year": 2019,
          "image" : "img/img/img/img12.jpg",
          "body":"One year after the Air Max 270, Nike debuted their second Air unit to be designed for lifestyle purposes with the Air Max 720. As opposed to the heel-only 270 Air unit, the 720 Air unit extends under the forefoot, and is also taller than the 270 by 6mm. New colorways of the Air Max 720 and additional designs based on its Air unit, including the basketball-inspired Air Max 720 SATRN and a hybrid based on the retro Air More up-tempo, continue to be released.",
          "link":"",
          "id":11
      }
      ]


    return (
      <Router>
        <div>
          <NavigationBar />
        </div>
        <Route exact path='/' component={Home} />
        <Route path='/blog' render={() => <Blog data={nikeAir} />} />

      </Router>
    )
  }
}
